------------------------------------------------------------------------------------------------------------
----------------------------------------- Airport Database System ------------------------------------------
------------------------------------------------------------------------------------------------------------

USE master;
GO

-- Disconnect all users from the 'Airport' database
ALTER DATABASE Airport SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
GO

-- Droping Database if it already exists
IF EXISTS (SELECT name FROM sys.databases WHERE name = 'Airport')
BEGIN
    DROP DATABASE Airport;
END
Go

-- Create Database
CREATE DATABASE Airport;
Go

-- Use Database Airport
USE Airport;
Go

------------------------------------------------------------------------------------------------------------
--------------------------------------------- Tables Creations ---------------------------------------------
------------------------------------------------------------------------------------------------------------

-- ========================
-- Table: Airline 
-- ========================
CREATE TABLE Airline (
    Airline_ID VARCHAR(20) PRIMARY KEY,
    Name VARCHAR(50) NOT NULL,
    Country VARCHAR(50) NOT NULL,
    Contact_No VARCHAR(20) NOT NULL,
    Email VARCHAR(100),
    Website VARCHAR(100)
);

-- ========================
-- Table: Runway 
-- ========================
CREATE TABLE Runway (
    Runway_ID VARCHAR(20) PRIMARY KEY,
    Runway_Length FLOAT NOT NULL,
    Runway_Width FLOAT NOT NULL
);

-- ========================
-- Table: Department
-- ========================
CREATE TABLE Department (
    Department_ID VARCHAR(20) PRIMARY KEY,
    Department_Name VARCHAR(50) NOT NULL
);

-- ========================
-- Table: Destination 
-- ========================
CREATE TABLE Destination (
    Destination_ID VARCHAR(20) PRIMARY KEY,
    Country VARCHAR(50) NOT NULL,
    City VARCHAR(50) NOT NULL,
    Airport VARCHAR(100) NOT NULL
);

-- ========================
-- Table: Pilot 
-- ========================
CREATE TABLE Pilot (
    Pilot_ID VARCHAR(20) PRIMARY KEY,
    FirstName VARCHAR(50) NOT NULL,
    LastName VARCHAR(50) NOT NULL,
    Gender VARCHAR(10) NOT NULL CHECK (LOWER(Gender) IN ('male', 'female', 'other')),
    Date_of_Birth DATE NOT NULL,
    Phone_No VARCHAR(20),
    Email VARCHAR(100),
    License_No VARCHAR(20) NOT NULL,
    License_Expiry_Date DATE NOT NULL,
    Nationality VARCHAR(50) NOT NULL,
    Passport_No VARCHAR(20),
    Rank VARCHAR(20) NOT NULL
);

-- ========================
-- Table: Passengers 
-- ========================
CREATE TABLE Passengers (
    Passenger_ID VARCHAR(20) PRIMARY KEY,
    FirstName VARCHAR(50) NOT NULL,
    LastName VARCHAR(50) NOT NULL,
    Gender VARCHAR(10) NOT NULL CHECK (LOWER(Gender) IN ('male', 'female', 'other')),
    Date_of_Birth DATE NOT NULL,
    Phone_No VARCHAR(20),
    Email VARCHAR(100) CHECK (Email LIKE '%@%.%'),
    Nationality VARCHAR(50) NOT NULL,
    Passport_No VARCHAR(20) NOT NULL,
    Passport_Expiry_Date DATE NOT NULL
);

-- ========================
-- Table: Employee 
-- ========================
CREATE TABLE Employee (
    Employee_ID VARCHAR(20) PRIMARY KEY,
    FirstName VARCHAR(50) NOT NULL,
    LastName VARCHAR(50) NOT NULL,
    Gender VARCHAR(10) NOT NULL CHECK (LOWER(Gender) IN ('male', 'female', 'other')),
    Date_of_Birth DATE NOT NULL,
    Phone_No VARCHAR(20),
    Email VARCHAR(100),
    Status VARCHAR(20) DEFAULT 'Active',
    Job_Title VARCHAR(50),
    Salary FLOAT NOT NULL,
    Hire_Date DATE NOT NULL,
    Department_ID VARCHAR(20) -- Foreign Key to Department Table
);

-- ===========================
-- Table: AirlineStaff 
-- ===========================
CREATE TABLE AirlineStaff (
    Staff_ID VARCHAR(20) PRIMARY KEY,
    Role VARCHAR(50) NOT NULL,
    FirstName VARCHAR(50) NOT NULL,
    LastName VARCHAR(50) NOT NULL,
    Gender VARCHAR(10) NOT NULL CHECK (LOWER(Gender) IN ('male', 'female', 'other')),
    Date_of_Birth DATE NOT NULL,
    Phone_No VARCHAR(20),
    Email VARCHAR(100),
    Salary FLOAT NOT NULL,
    Hire_Date DATE NOT NULL,
    Airline_ID VARCHAR(20), -- Foreign Key to Airline Table
);

-- ========================
-- Table: Ticket
-- ========================
CREATE TABLE Ticket (
    Ticket_ID VARCHAR(20) PRIMARY KEY,
    Passenger_ID VARCHAR(20) NOT NULL, -- Foreign Key to Passengers Table
    Seat_No VARCHAR(20),
    Class VARCHAR(20) NOT NULL CHECK (LOWER(Class) IN ('first class', 'business', 'economy')) DEFAULT 'Economy',
    Booking_Date DATE NOT NULL,
    Price FLOAT NOT NULL,
    Baggage_Allowance FLOAT,
    Flight_ID VARCHAR(20) NOT NULL -- Foreign Key to Flight Table
);

-- ========================
-- Table: Baggages 
-- ========================
CREATE TABLE Baggages (
    Baggage_ID VARCHAR(20) PRIMARY KEY,
    Weight FLOAT,
    Status VARCHAR(20),
    Ticket_ID VARCHAR(20) -- Foreign Key to Ticket Table (Ticket_ID)
);

-- ========================
-- Table: Plane 
-- ========================
CREATE TABLE Plane (
    Plane_ID VARCHAR(20) PRIMARY KEY,
    Name VARCHAR(50) NOT NULL,
    Model VARCHAR(50),
    Capacity INT NOT NULL,
    Manufacture_Date DATE NOT NULL,
    Status VARCHAR(20) NOT NULL DEFAULT 'Active',
    Airline_ID VARCHAR(20), -- Foreign Key to Airline Table
    Registration_No VARCHAR(20)
);

-- ========================
-- Table: Flight 
-- ========================
CREATE TABLE Flight (
    Flight_ID VARCHAR(20) PRIMARY KEY,
    Departure_From VARCHAR(20) NOT NULL, -- Foreign Key to Destination Table
    Arrival_To VARCHAR(20) NOT NULL, -- Foreign Key to Destination Table
    Departure_Date DATETIME NOT NULL,
    Arrival_Date DATETIME NOT NULL,
    Expected_Arrival_Time DATETIME NOT NULL,
    Flight_Distance FLOAT NOT NULL,
    Flight_Duration TIME NOT NULL,
    Is_Connecting VARCHAR(10) NOT NULL,
    Flight_Type VARCHAR(15) NOT NULL CHECK (Flight_Type IN ('Domestic', 'International')),
    Runway_ID VARCHAR(20), -- Foreign Key to Runway Table
    Runway_Start_Time TIME NOT NULL,
    Runway_End_Time TIME NOT NULL,
    Plane_ID VARCHAR(20) -- Foreign Key to Plane Table
);

-- ========================
-- Table: PilotFlights
-- ========================
CREATE TABLE PilotFlights (
    Pilot_ID_1 VARCHAR(20) NOT NULL, -- Foreign Key to Pilot Table Pilot
    Pilot_ID_2 VARCHAR(20)NOT NULL, -- Foreign Key to Pilot Table Co-Piolt
    Pilot_ID_3 VARCHAR(20), -- Foreign Key to Pilot Table (Optional)
    Pilot_ID_4 VARCHAR(20), -- Foreign Key to Pilot Table (Optional)
    Flight_ID VARCHAR(20), -- Foreign Key to Flight Table
);

-- =========================
-- Table: ConnectingFlights
-- =========================
CREATE TABLE ConnectingFlights (
    Flight_ID VARCHAR(20), -- Foreign Key to Flight table
    Stop_Sequence INT, -- Order of the stopovers (1 = first stop, 2 = second stop, etc.)
    Departure_From VARCHAR(20), -- Foreign Key to Destination table
    Arrival_To VARCHAR(20), -- Foreign Key to Destination table
    Layover_Duration TIME, -- Duration of layover at the connecting destination
    Plane_ID VARCHAR(20) -- Foreign Key to Plane table
    PRIMARY KEY (Flight_ID, Stop_Sequence)
);

------------------------------------------------------------------------------------------------------------
--------------------------------------------- Foreign Keys Addition ----------------------------------------
------------------------------------------------------------------------------------------------------------

-- Foreign Key Constraints for Employee Table
ALTER TABLE Employee ADD CONSTRAINT FK_Department_Employee FOREIGN KEY (Department_ID) REFERENCES Department(Department_ID);

-- Foreign Key Constraints for AirlineStaff Table
ALTER TABLE AirlineStaff ADD CONSTRAINT FK_Airline_AirlineStaff FOREIGN KEY (Airline_ID) REFERENCES Airline(Airline_ID);

-- Foreign Key Constraints for Ticket Table
ALTER TABLE Ticket ADD CONSTRAINT FK_Passenger_Ticket FOREIGN KEY (Passenger_ID) REFERENCES Passengers(Passenger_ID);
ALTER TABLE Ticket ADD CONSTRAINT FK_Flight_Ticket FOREIGN KEY (Flight_ID) REFERENCES Flight(Flight_ID);

-- Foreign Key Constraints for Baggages Table
ALTER TABLE Baggages ADD CONSTRAINT FK_Ticket_Baggages FOREIGN KEY (Ticket_ID) REFERENCES Ticket(Ticket_ID);

-- Foreign Key Constraints for Plane Table
ALTER TABLE Plane ADD CONSTRAINT FK_Airline_Plane FOREIGN KEY (Airline_ID) REFERENCES Airline(Airline_ID);

-- Foreign Key Constraints for Flight Table
ALTER TABLE Flight ADD CONSTRAINT FK_Departure_From_Flight FOREIGN KEY (Departure_From) REFERENCES Destination(Destination_ID);
ALTER TABLE Flight ADD CONSTRAINT FK_Arrival_To_Flight FOREIGN KEY (Arrival_To) REFERENCES Destination(Destination_ID);
ALTER TABLE Flight ADD CONSTRAINT FK_Plane_Flight FOREIGN KEY (Plane_ID) REFERENCES Plane(Plane_ID);
ALTER TABLE Flight ADD CONSTRAINT FK_Runway_Flight FOREIGN KEY (Runway_ID) REFERENCES Runway(Runway_ID);

-- Foreign Key Constraints for PilotFlights Table
ALTER TABLE PilotFlights ADD CONSTRAINT FK_Pilot_1_PilotFlights FOREIGN KEY (Pilot_ID_1) REFERENCES Pilot(Pilot_ID);
ALTER TABLE PilotFlights ADD CONSTRAINT FK_Pilot_2_PilotFlights FOREIGN KEY (Pilot_ID_2) REFERENCES Pilot(Pilot_ID);
ALTER TABLE PilotFlights ADD CONSTRAINT FK_Pilot_3_PilotFlights FOREIGN KEY (Pilot_ID_3) REFERENCES Pilot(Pilot_ID);
ALTER TABLE PilotFlights ADD CONSTRAINT FK_Pilot_4_PilotFlights FOREIGN KEY (Pilot_ID_4) REFERENCES Pilot(Pilot_ID);
ALTER TABLE PilotFlights ADD CONSTRAINT FK_Flight_PilotFlights FOREIGN KEY (Flight_ID) REFERENCES Flight(Flight_ID);

-- Foreign Key Constraints for ConnectingFlights Table
ALTER TABLE ConnectingFlights ADD CONSTRAINT FK_Flight_ConnectingFlights FOREIGN KEY (Flight_ID) REFERENCES Flight(Flight_ID);
ALTER TABLE ConnectingFlights ADD CONSTRAINT FK_Departure_From_ConnectingFlights FOREIGN KEY (Departure_From) REFERENCES Destination(Destination_ID);
ALTER TABLE ConnectingFlights ADD CONSTRAINT FK_Arrival_To_ConnectingFlights FOREIGN KEY (Arrival_To) REFERENCES Destination(Destination_ID);
ALTER TABLE ConnectingFlights ADD CONSTRAINT FK_Plane_ConnectingFlights FOREIGN KEY (Plane_ID) REFERENCES Plane(Plane_ID);

